import React from 'react';

const Starred = ({ starred }) => (
    <div className="card card-body mb-2">
        <div className="row">
            <button className="col-mb-6 btn btn-primary">
                Nome do repositório: <span className="badge badge-info"> { starred.name }</span>
            </button>
            <div className="col-md-6">
                <span className="badge badge-dark"> Criador do repositório: { starred.owner.login}</span>
            </div>
        </div>
    </div>
)

export default Starred;

